# Windows API: 排除窗口捕获
try:
    user32 = ctypes.windll.user32
    _SetWindowDisplayAffinity = getattr(user32, "SetWindowDisplayAffinity", None)
    WDA_EXCLUDEFROMCAPTURE = 0x00000011
except Exception:
    _SetWindowDisplayAffinity = None
    WDA_EXCLUDEFROMCAPTURE = 0x11


def set_window_exclude_from_capture(hwnd: int):
    if _SetWindowDisplayAffinity:
        try:
            _SetWindowDisplayAffinity(wintypes.HWND(hwnd), WDA_EXCLUDEFROMCAPTURE)
        except Exception:
            pass


def ensure_dir(p: Path):
    p.mkdir(parents=True, exist_ok=True)
    return p


def timestamp_filename():
    return datetime.now().strftime("%Y-%m-%d_%H-%M-%S") + ".mp4"


def fit_frame_letterbox(frame_bgr: np.ndarray, out_w: int, out_h: int) -> np.ndarray:
    h, w = frame_bgr.shape[:2]
    if w == 0 or h == 0:
        return np.zeros((out_h, out_w, 3), dtype=np.uint8)
    scale = min(out_w / w, out_h / h)
    new_w = max(1, int(round(w * scale)))
    new_h = max(1, int(round(h * scale)))
    resized = cv2.resize(frame_bgr, (new_w, new_h), interpolation=cv2.INTER_AREA)
    canvas = np.zeros((out_h, out_w, 3), dtype=np.uint8)
    x = (out_w - new_w) // 2
    y = (out_h - new_h) // 2
    canvas[y:y + new_h, x:x + new_w] = resized
    return canvas


# ---------- RegionSelector ----------
class RegionSelector(QtWidgets.QWidget):
    regionSelected = QtCore.pyqtSignal(QtCore.QRect)
    selectionCanceled = QtCore.pyqtSignal()

    def __init__(self):
        super().__init__()
        self.setWindowFlags(
            QtCore.Qt.WindowType.FramelessWindowHint |
            QtCore.Qt.WindowType.WindowStaysOnTopHint
        )
        self.setAttribute(QtCore.Qt.WidgetAttribute.WA_TranslucentBackground, True)
        self.setCursor(QtCore.Qt.CursorShape.CrossCursor)
        rect = QtCore.QRect()
        for screen in QtGui.QGuiApplication.screens():
            rect = rect.united(screen.geometry())
        self.setGeometry(rect)
        self._start = None
        self._end = None
        self._pen = QtGui.QPen(QtGui.QColor(0, 120, 255, 255), 2)
        self._brush = QtGui.QBrush(QtGui.QColor(0, 120, 255, 60))

    def keyPressEvent(self, e: QtGui.QKeyEvent):
        if e.key() == QtCore.Qt.Key.Key_Escape:
            self.selectionCanceled.emit()
            self.close()

    def mousePressEvent(self, e: QtGui.QMouseEvent):
        self._start = e.globalPosition().toPoint()
        self._end = self._start
        self.update()

    def mouseMoveEvent(self, e: QtGui.QMouseEvent):
        if self._start is not None:
            self._end = e.globalPosition().toPoint()
            self.update()

    def mouseReleaseEvent(self, e: QtGui.QMouseEvent):
        if self._start is None:
            return
        self._end = e.globalPosition().toPoint()
        rect = QtCore.QRect(self._start, self._end).normalized()
        self.regionSelected.emit(rect)
        self._start = None
        self._end = None
        self.close()

    def paintEvent(self, e: QtGui.QPaintEvent):
        p = QtGui.QPainter(self)
        p.setRenderHint(QtGui.QPainter.RenderHint.Antialiasing)
        p.fillRect(self.rect(), QtGui.QColor(0, 0, 0, 60))
        if self._start and self._end:
            r = QtCore.QRect(self._start, self._end).normalized()
            p.setPen(self._pen)
            p.setBrush(self._brush)
            p.drawRect(r)


# ---------- TimerOverlay ----------
class TimerOverlay(QtWidgets.QWidget):
    def __init__(self):
        super().__init__(None, QtCore.Qt.WindowType.FramelessWindowHint | QtCore.Qt.WindowType.Tool)
        self.setAttribute(QtCore.Qt.WidgetAttribute.WA_TranslucentBackground, True)
        self.setWindowFlag(QtCore.Qt.WindowType.WindowStaysOnTopHint, True)
        self.label = QtWidgets.QLabel("00:00:00", self)
        self.label.setAlignment(QtCore.Qt.AlignmentFlag.AlignCenter)
        f = QtGui.QFont("Segoe UI", 14, QtGui.QFont.Weight.DemiBold)
        self.label.setFont(f)
        self.label.setStyleSheet("""
            QLabel{
                color:#fff; background:rgba(0,0,0,160);
                border:1px solid rgba(255,255,255,120);
                border-radius:12px; padding:8px 16px;
            }
        """)
        self.resize(160, 52)
        screen_geo = QtGui.QGuiApplication.primaryScreen().availableGeometry()
        self.move(screen_geo.right() - self.width() - 20, screen_geo.top() + 20)
        self._start_ts = None
        self._paused = False
        self._paused_acc = 0.0
        self._paused_start = None
        self.show()
        try:
            hwnd = int(self.winId())
            set_window_exclude_from_capture(hwnd)
        except Exception:
            pass
        self._timer = QtCore.QTimer(self)
        self._timer.timeout.connect(self._tick)
        self._timer.start(1000)

    def start(self):
        self._start_ts = time.time()
        self._paused = False
        self._paused_acc = 0.0
        self._paused_start = None
        self._set_text("00:00:00")

    def _set_text(self, t: str):
        self.label.setText(t)

    def pause(self, paused: bool):
        if paused and not self._paused:
            self._paused = True
            self._paused_start = time.time()
            self._set_text(self.label.text() + "  (暂停)")
        elif not paused and self._paused:
            self._paused = False
            self._paused_acc += time.time() - (self._paused_start or time.time())
            self._paused_start = None

    def _tick(self):
        if self._start_ts is None or self._paused:
            return
        elapsed = int(time.time() - self._start_ts - self._paused_acc)
        h, m, s = elapsed // 3600, (elapsed % 3600) // 60, elapsed % 60
        self._set_text(f"{h:02d}:{m:02d}:{s:02d}")


# ---------- RecorderWorker ----------
class RecorderWorker(QtCore.QObject):
    recordingStarted = QtCore.pyqtSignal(str)
    recordingStopped = QtCore.pyqtSignal(str)
    errorOccurred = QtCore.pyqtSignal(str)
    pausedChanged = QtCore.pyqtSignal(bool)

    def __init__(self, bbox, save_dir, fps=DEFAULT_FPS, codec=DEFAULT_CODEC, out_size=(1920, 1080)):
        super().__init__()
        self.bbox, self.save_dir, self.fps, self.codec, self.out_size = bbox, save_dir, fps, codec, out_size
        self._running, self._paused = False, False

    @QtCore.pyqtSlot()
    def start(self):
        try:
            ensure_dir(self.save_dir)
            filepath = str(self.save_dir / timestamp_filename())
            fourcc = cv2.VideoWriter_fourcc(*self.codec)
            out_w, out_h = self.out_size
            out = cv2.VideoWriter(filepath, fourcc, float(self.fps), (out_w, out_h))
            if not out.isOpened():
                raise RuntimeError("无法打开视频写入器")
            self._running, self._paused = True, False
            self.recordingStarted.emit(filepath)
            sct, interval = mss.mss(), 1.0 / self.fps
            next_t = time.time()
            while self._running:
                if self._paused:
                    time.sleep(0.05)
                    continue
                img = sct.grab(self.bbox)
                frame = cv2.cvtColor(np.array(img), cv2.COLOR_BGRA2BGR)
                frame = fit_frame_letterbox(frame, out_w, out_h)
                out.write(frame)
                next_t += interval
                sleep_t = next_t - time.time()
                time.sleep(max(sleep_t, 0))
            out.release()
            self.recordingStopped.emit(filepath)
        except Exception as e:
            self.errorOccurred.emit(str(e))

    @QtCore.pyqtSlot()
    def stop(self):
        self._running = False

    @QtCore.pyqtSlot()
    def toggle_pause(self):
        self._paused = not self._paused
        self.pausedChanged.emit(self._paused)


