        ali_vbox = QtWidgets.QVBoxLayout()
        ali_lbl = QtWidgets.QLabel("支付宝")
        ali_lbl.setAlignment(QtCore.Qt.AlignmentFlag.AlignCenter)
        ali_qr = QtWidgets.QLabel()
